                        <ul class="navbar-nav">
                            <li class="nav-item">
                                <Link class="nav-link active" aria-current="page" to="users">Users</Link>
                            </li>
                            <li class="nav-item">
                                <Link  class="nav-link active" aria-current="page" to="logout" >Logout</Link>
                            </li>
                        </ul>
                    </div>
                </div>
            </nav>

            <h1> Welcome Admin </h1>
            <Outlet />
            
        </div>
    )
}
